import './index.css';
import { Link, animateScroll as scroll } from 'react-scroll';

export default function Home() {

    function scrolldiv() {
        const elem = document.getElementById("about");
        elem.scrollIntoView();
    }

    return (
        <div>
            <div className='home-container'>
                {/* <nav style={{ 
                    display: 'flex', 
