                    <Link to='home' activeClass="active" className="nav-item" spy={true} smooth={true}>Home</Link>
                    <Link to='about' className="nav-item" spy={true} smooth={true}>About Me</Link>
                    <Link to='languages' className="nav-item" spy={true} smooth={true}>Languages</Link>
                    <Link to='portfolio' className="nav-item" spy={true} smooth={true}>Portfolio</Link>
                    <Link to='resume' className="nav-item" spy={true} smooth={true}>Resume</Link>
                </nav> */}
