                    display: 'flex',
                    position: 'relative',
                    fontSize: '40px',
                    fontWeight: 'bold',
                    justifyContent: 'center',
                    alignItems: 'center',
                    marginTop: '100px',
                    color: 'white'
                }}><h1>TAYLER RADCLIFFE</h1>
                    <h5 style={{ display: 'flex', position: 'absolute', marginTop: '250px' }}>Software Developer</h5>
                </div>

                <div class="container" style={{
                    position: 'absolute',
                    fontSize: '60px',
                    marginTop: '600px',
                    alignItems: 'center',
                    justifyContent: 'center'
                }}>
                    <div class="arrow" onClick={scrolldiv}>
                    </div>
                    <div style={{
                        marginLeft: '-200px'
                    }} class="arrow" >
                    </div>
                    <div style={{
                        marginLeft: '150px'
                    }} class="arrow" >
                    </div>
                </div>
            </div>
        </div>

    )
}
